import React, { Component } from 'react';
import 'normalize.css';
import './App.scss';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      markdown:''
    }
  }

  render() {
    return (
      <div className="App">
        <div>
          <div className="1">
            <div>
              <h2><i>yigejiaha</i> 新建笔记</h2>
            </div>
            <div>
              <i></i>笔记本
              <div className="1"><i className="icon"></i>默认笔记本</div>
              <div className="1"><i className="icon"></i>我的2020</div>
              <div className="1"><i className="icon"></i>读书笔记</div>
            </div>
          </div>

          <div className="2">
            <h1>读书笔记</h1>
            <hr/>
            <div className="content"></div>
          </div>

          <div className="3">markdown 部分
          <div>  <span><i className="icon"></i>读书笔记</span> </div>
          <hr/>
          <div>
            <div className="tittle"></div>
            <div>
              <textarea value="" ></textarea>
              <div></div>
            </div>
          </div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
